import React from 'react';
// import logo from './logo.svg';
import {useState} from 'react'
import './App.css';
import Modal from '../Components/Modal'
import axios from 'axios'
// import Test from "../pages/Test";
// import Kakao from "./Kakao";
import { Route, Link } from "react-router-dom";


function App() {
  const [openModal, setOpenmodal] = useState(false)
  return (
    <div className="App">
    <h1>Hey, Click on the button to open the modal.</h1>
    <button className="openmodalBtn" onClick={()=>setOpenmodal(true)} >Open</button>
     { openModal && <Modal closeModal={setOpenmodal} />}

     </div>

  );
}
const Url= 'http://apis.data.go.kr/1360000/MidFcstInfoService/getMidLandFcst?serviceKey=l5%2FARvs4Y21x2OnTnwqvAR87P6RFjU70RblX6HyCCZcmvsthsQ2yVRFPNPuFM5afm%2BK4Mqq8txMqcxo3I25Zqw%3D%3D&numOfRows=10&pageNo=1';

axios.fetch(Url).then((res)=>console.log(res)).catch((error)=>console.log(error));

export default App;
